import React, { Component } from "react";
import { Card } from 'antd';
import "./home.less";

/* 首页路由 */
export default class Home extends Component {
  render() {
    return (
      <div className="home">
        <Card
          title="商品总量"
          style={{ width: 300 }}
        >
          <p>Card content</p>
          <p>Card content</p>
          <p>Card content</p>
        </Card>
      </div>
    );
  }
}
